import { useParams } from "react-router-dom";
import { productsApi } from "../../../store/servises";

export const ProductPage = () => {
  const { id } = useParams();
  const { data: product } = productsApi.useGetProductByIdQuery({ id });
  console.log(product);

  return (
    <div>
      <h4> {product.title}</h4>
      <p>{product.descr}</p>
    </div>
  );
};
